#include <iostream>
#include <vector>
#include <stack>
#include <algorithm>
#include <string>
#include <queue>
#include <set>

using namespace std;

class Solution {
public:
    int maximalSquaredp(vector<vector<char>>& matrix) {
       if (matrix.size() == 0 || matrix[0].empty()) {
            return 0;
        }

        const size_t W{matrix[0].size()};
        const size_t H{matrix.size()};
        vector<vector<int>> dp(H, vector<int>(W));
        int max_size{0};
        for (int i = 0; i < H; i++) {
            for (int j = 0; j < W; j++) {
                if (matrix[i][j] == '1') {
                    if (i == 0 || j == 0) {
                        dp[i][j] = 1;
                    } else {
                        dp[i][j] = min({dp[i - 1][j], dp[i][j - 1], dp[i - 1][ j - 1]}) + 1;
                    }
                    max_size = max(max_size, dp[i][j]);
                }
                
            }
        }
        return max_size * max_size;
    }
    int maximalSquare(vector<vector<char>>& matrix) {
        
        if (matrix.size() == 0) {
            return 0;
        }
        
        const size_t W{matrix[0].size()};
        const size_t H{matrix.size()};
        
        const int max_sq = min(W, H);
        int l_sq{0};
        
        // fill up a set with all ones in the matrix
        set<pair<int, int>> ones;
        for (int r = 0; r < H; r++) {
            for (int c = 0; c < W; c++) {
                if (matrix[r][c] == '1') {
                    ones.insert({r, c});
                }
            }
        }
        
        auto all_ones = [&](int r, int c, int sq_size) {
            if (ones.find({r + sq_size - 1, c + sq_size - 1}) == ones.end() || ones.find({r, c}) == ones.end()) {
                return false;
            }
            //cout << " r " << r << " c " << c << " size " << sq_size << endl;
            for (int i = r; i < r + sq_size; i++) {
                for (int j = c; j < c + sq_size; j++) {
                    if (ones.find({i, j}) == ones.end()) {
                        return false;
                    }
                }
            }
            return true;
        };
        
        auto valid = [&](int r, int c, int sq_size) {return r >= 0 && c >= 0 && (r + sq_size <= H) && (c + sq_size <= W);};
        
        for (auto p: ones) {
            for (int ss = max_sq; ss >= 1; ss--) {
                if ((ss > l_sq) && valid(p.first, p.second, ss) && all_ones(p.first, p.second, ss)) {
                    cout << "x = " << p.first << "y = " << p.second << "sq " << ss << endl;
                    l_sq = max(l_sq, ss);
                } 
            }
        }
        
        cout << "w = " << W << " h = " << H << endl;
        return l_sq * l_sq ;
    }
};

